import { Box, Paper, TableContainer, Table, TableHead, TableRow, TableCell, TableBody } from '@material-ui/core';
import React, { useState } from 'react';
import BodyStyle from './body.style';

function Body(props) {
  const styles = BodyStyle();
  const [rows, setRows] = useState([]);

  return (
    <Box className={styles.body} minHeight={props.emptySpace}>
      <TableContainer component={Paper}>
        <Table className={styles.table} size="small" aria-label="user table">
          <TableHead>
            <TableRow>
              <TableCell >USU√ÅRIO</TableCell>
              <TableCell >EMAIL</TableCell>
              <TableCell >Fat&nbsp;(g)</TableCell>
              <TableCell >Carbs&nbsp;(g)</TableCell>
              <TableCell >Protein&nbsp;(g)</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow key={row.name}>
                <TableCell component="th" scope="row">
                  {row.name}
                </TableCell>
                <TableCell align="right">{row.calories}</TableCell>
                <TableCell align="right">{row.fat}</TableCell>
                <TableCell align="right">{row.carbs}</TableCell>
                <TableCell align="right">{row.protein}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
}

export default Body;
